class Solution {
    fun leftmostBuildingQueries(heights: IntArray, queries: Array<IntArray>): IntArray {
        return queries.map { query ->
            val (start, end) = query
            var leftmost = -1
            if (start < end && heights[start] < heights[end]) {
                for (i in start + 1..end) {
                    if (heights[start] < heights[i] && heights[end] <= heights[i]) {
                        leftmost = i
                        break
                    }
                }
            } else if (start < end) {
                var max = Int.MIN_VALUE
                for (i in start + 1 until end) {
                    if (heights[i] > max) {
                        max = heights[i]
                        if (heights[end] <= max) {
                            leftmost = i
                            break
                        }
                    }
                }
            }
            leftmost
        }.toIntArray()
    }
}
